import React from 'react'

import {FaFile, FaImage,FaVideo, FaLink,FaPlus } from 'react-icons/fa';
import { PostsData } from '../../Data/PostsData'
import Resources from '../Ress/ResourceSide' 

import './ResourceSide.css'

const ResourceSide = () => {
  return (
    <div className='resource-page'>
      <div className='resource-page-header'>
        <button type='submit'><FaFile size={'1.5rem'} color='#ffffff'/></button>
        <button type='submit'><FaImage size={'1.5rem'} color='#ffffff'/></button>
        <button type='submit'><FaVideo size={'1.5rem'} color='#ffffff'/></button>
        <button type='submit'><FaLink size={'1.5rem'} color='#ffffff'/></button>
        <button type='submit'><FaPlus size={'1.5rem'} color='#ffffff'/></button>
      </div>
      <div>
      <div className="Posts">
        {PostsData.map((post, id)=>{
            return <RessourceSide data={post} id={id}/>
        })}
    </div>

      </div>
    </div>
  )
}

export default ResourceSide;
